import React from "react";
import { useForm, useFieldArray } from "react-hook-form";

function DynamicFormField() {
  const form = useForm({
    defaultValues: {
      username: "",
      email: "",
      address: {
        houseNo: "",
        state: "",
      },
      phone: ["", ""],
      phNumbers: [{ number: "" }],
    },
  });

  // Setting defaultValues from an API response
  //   const form = useForm({
  //     defaultValues: async () => {
  //       const res = await fetch("https://jsonplaceholder.typicode.com/users/1");
  //       const data = await res.json();
  //       return {
  //         username: "Batman",
  //         email: data.email,
  //       };
  //     },
  //   });

  const { register, control, handleSubmit, formState } = form;

  const { errors } = formState;

  const { fields, append, remove } = useFieldArray({
    name: "phNumbers",
    control,
  });

  const onFormSubmit = (data) => {
    console.log("Form Submitted!");
    console.log(data); // {"username" : "Vikas", "email" : "vikas@gmail.com"}
  };

  return (
    <div>
      <form onSubmit={handleSubmit(onFormSubmit)}>
        <div>
          <label>Name: </label>
          <input
            type="text"
            name="name"
            {...register("username", {
              required: {
                value: true,
                message: "Username is required",
              },
              validate: {
                notVikas: (fieldValue) => {
                  return fieldValue !== "vikas" || "Name is taken";
                },
                notPandey: (fieldValue) => {
                  return fieldValue !== "pandey" || "Also is taken";
                },
              },
            })}
          />
          <p>{errors.username?.message}</p>
        </div>
        <div>
          <label>Email:</label>
          <input type="email" name="email" {...register("email")} />
        </div>
        <div>
          <div>
            <label>House No:</label>
            <input type="text" name="hno" {...register("address.houseNo")} />
          </div>
          <div>
            <label>State:</label>
            <input type="text" name="state" {...register("address.state")} />
          </div>
        </div>

        <div>
          <div>
            <label>Primary Phone</label>
            <input type="text" name="primaryPhone" {...register("phone.0")} />
          </div>
          <div>
            <label>Secondary Phone:</label>
            <input type="text" name="secondaryPhone" {...register("phone.1")} />
          </div>
        </div>

        <div>
          <label>List of phone numbers</label>
          <div>
            {fields.map((field, index) => {
              return (
                <div key={field.id}>
                  <input
                    type="text"
                    {...register(`phNumbers.${index}.number`)}
                  />
                  {index > 0 && (
                    <button type="button" onClick={() => remove(index)}>
                      Remove phone number
                    </button>
                  )}
                </div>
              );
            })}
            <button type="button" onClick={() => append({ number: "" })}>
              Add new phone number
            </button>
          </div>
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default DynamicFormField;
